// Main function
async function main() {
  console.log('üå± Starting names database seeding...');
  
  try {
    // Check if names already exist
    const hasExistingNames = await checkExistingNames();
    if (hasExistingNames) {
      console.log('‚úÖ Names already exist in database. Skipping seeding.');
      return;
    }
    
    // Seed the names
    const success = await seedNames();
    if (success) {
      console.log('‚úÖ Successfully seeded names to Firebase!');
      
      // Add custom names if any
      await addCustomNames();
      
      console.log('üéâ Names database is ready for autocomplete functionality.');
    } else {
      console.error('‚ùå Failed to seed names to Firebase.');
    }
  } catch (error) {
    console.error('‚ùå Error during seeding:', error);
  }
  
  console.log('üéØ Names database seeding completed successfully!');
}

